	RC_COUNT = #RC_TABLE
	local LastIndex = 1
	if IsMouseButtonPressed(3)then 
		if (LastIndex <= RC_COUNT) then
			i = LastIndex
		else
			i = 1
		end
		while i <= RC_COUNT do
			if not IsMouseButtonPressed(1) then
				LastIndex = i
				break
			end
